//O componente App.js é o principalo ponto de entrada de uma aplicação React, elel é onde é definido a estrutura do componente principal de uma aplicação. Neste caso,
//o componente App é renderizado dentro da <div id="root"> no HTML. O conteúdo desse 
//componente pode incluir outros componentes, estilização, e lógica específica da aplicação.
//o componente App 

import './App.css'; //faz a importação do arquivo de estilos CSS associado ao componente App.
import Login from './components/Login'; //faz a importação do componente Login do arquivo ./components/Login.

function App() { //define o componente principal App.


  return ( //define o retorno a estrutura do componente App.
    <div className="App"> {/*define uma div com a classe "App" para conter todos os elementos do componente App. */}
      <header className="App-header"> {/*cabeçalho da aplicação, utilizando a classe "App-header" para estilização. */}
        <Login /> {/*renderiza o componente Login dentro do cabeçalho da aplicação. */}
      </header>
    </div>
  );
}

export default App; //exporta o componente App para que possa ser utilizado em outros arquivos.
